import React from 'react';
import '../../App.css';

export default function ArticleCard (articleContent){
	console.log('articleContent', articleContent);
	return (
		<div>
			<p>{articleContent.articleContent.title}</p>
			<p>{articleContent.articleContent.blurb}</p>
			<img src={'https://www.google.com/url?sa=i&source=images&cd=&ved=2ahUKEwiswNq6zNPkAhWHzIUKHYvKC-AQjRx6BAgBEAQ&url=https%3A%2F%2Fottawacitizen.com%2Fnews%2Flocal-news%2Fsaving-baby-mango-a-pigs-tale-of-kindness&psig=AOvVaw2V51Px7ITGG23JEP5Vwo09&ust=1568663338657877'}></img>
		</div>
	)
}
